style.css:
@-moz-document domain("youtube.com") {
/* Background */
    body, #page-manager {
        background-color: #ffe6f2 !important;
    }
    
    /* Header */
    #masthead-container {
        background-color: #ffb6c1 !important;
    }
    
    /* Sidebar */
    #guide-inner-content {
        background-color: #ffccdc !important;
    }
    
    /* Video titles and text */
    .title, .style-scope ytd-video-primary-info-renderer, .style-scope ytd-video-secondary-info-renderer {
        color: #ff69b4 !important;
    }

    /* Buttons */
    .ytp-chrome-controls, .ytp-button {
        background-color: #ff99cc !important;
        border-color: #ff99cc !important;
    }
    
    /* Video player background */
    .html5-video-container {
        background-color: #ffebf5 !important;
    }
    
    /* Search bar */
    #search-form {
        background-color: #ffc0cb !important;
    }

    /* My Melody Images */
    #logo-icon-container::before {
        content: url('https://example.com/my-melody-logo.png') !important;
    }
    
    /* Links and buttons */
    a, .yt-simple-endpoint {
        color: #ff69b4 !important;
    }
    
    /* Footer */
    #footer-container {
        background-color: #ffc0cb !important;
    }
}
